declare(strict_types=1);

namespace bora\network\mcpe\protocol;

use bora\utils\Binary;

use bora\network\mcpe\NetworkSession;
use function base64_decode;

class AvailableEntityIdentifiersPacket extends DataPacket{
	public const NETWORK_ID = ProtocolInfo::AVAILABLE_ENTITY_IDENTIFIERS_PACKET;

	/**
	 * Hardcoded NBT blob extracted from MCPE vanilla server.
	 * TODO: this needs to be generated dynamically, but this is here for stable backwards compatibility, so we don't care for now.
	 */
	private const HARDCODED_NBT_BLOB = "";

	/** @var string */
	public $namedtag;

	protected function decodePayload(){
		$this->namedtag = $this->getRemaining();
	}

	protected function encodePayload(){
		($this->buffer .= $this->namedtag ?? base64_decode(self::HARDCODED_NBT_BLOB));
	}

	public function handle(NetworkSession $session) : bool{
		return $session->handleAvailableEntityIdentifiers($this);
	}
}
